import React from 'react'
import '../style/Signin.css';

function Signin() {
    return (
        <div className='sign_in'>
            <h1>Sign in</h1>
            <form className='signin_form'>
                <input type="text" />
                <input type="email" />
                <input type="password" />
                <input type={"submit"}
                    style={{ backgroundColor: "#a1eafb" }} />
            </form>
        </div>
    )
}

export default Signin
